window.bookSummaryJSON = "<p><b>The final part of Caiden and Winter's story.</b></p> <p>Secrets and lies are being revealed. Loyalties are being tested, and betrayal cuts deep.</p> <p>My mother needs to be stopped, but at what cost?</p> <p>At the end, who will be left standing?</p> <p>And...who will fall?</p> <p>Eeny, meeny, miny, mo.</p> <p>You underestimated the Four and Snow.</p> <p>You thought you were on a winning streak.</p> <p>But are you prepared for the havoc we wreak?</p> <p><b>Note: </b>This book is not a stand-alone and should be listened to after<i> The Secrets We Hide</i>.</p>"; 
